import React,{useState} from 'react'

export const Body = () => {
    const [count, setCount] = useState(0)
  return (
    <div className='body'>
        <button className='btn' onClick={()=>{
            count=count-1;
            setCount(count)
        }}>-</button>
        <input type="text"/>
        <button className='btn' onClick={()=>{
            count=count+1;
            setCount(count)
        }}>+</button><br/>
        <label> Count : {count} </label>
    </div>
  )
}
